import React, { useEffect, useState } from 'react';
import logincss from '../assets/css/login.css';

function Login() {
    const [activePanel, setActivePanel] = useState('sign-in');

    useEffect(() => {
        const signUpButton = document.getElementById('signUp');
        const signInButton = document.getElementById('signIn');
        const container = document.getElementById('container');

        // if (signUpButton && signInButton && container) {
        signUpButton.addEventListener('click', () => {
            container.classList.add("right-panel-active");
        });

        signInButton.addEventListener('click', () => {
            container.classList.remove("right-panel-active");
        });

        return () => {
            signUpButton.removeEventListener('click', () => {
                container.classList.add("right-panel-active");
            });

            signInButton.removeEventListener('click', () => {
                container.classList.remove("right-panel-active");
            });
        };
        // }
    }, []);

    return (
        <div>
            <head>
                <meta charSet="UTF-8" />
                <meta name="viewport" content="width=device-width, initial-scale=1.0" />
                <title>Login</title>
                <link rel="stylesheet" href={logincss} />
            </head>
            <body id='loginbody'>
                <div className="containerlogin" id="container">
                    <div className={`form - container ${activePanel === 'sign-up' ? 'sign-up-container active' : 'sign-up-container'}`}>
                        <form action="#" className="frm">
                            <h1 className="h1">Create Account</h1>
                            <input className="inp" type="text" placeholder="Name" />
                            <input className="inp" type="email" placeholder="Email" />
                            <input className="inp" type="password" placeholder="Password" />
                            <button className="lgbtn">Sign Up</button>
                        </form>
                    </div>
                    <div className="form-container sign-in-container">
                        <form action="#" className="frm">
                            <h1 className="h1">Sign in</h1>
                            <input className="inp" type="email" placeholder="Email" />
                            <input className="inp" type="password" placeholder="Password" />
                            <a id='ancor' href="#">Forgot your password?</a>
                            <button className="lgbtn">Sign In</button>
                        </form>
                    </div>
                    <div className="overlay-container">
                        <div className="overlay">
                            <div className="overlay-panel overlay-left">
                                <h1 className="h1">Welcome Back!</h1>
                                <p className="para">To keep connected with us please login with your personal info</p>
                                <button className="ghost lgbtn" id="signIn">Sign In</button>
                            </div>
                            <div className="overlay-panel overlay-right">
                                <h1 className="h1">Hello, Friend!</h1>
                                <p className="para">Enter your personal details and start journey with us</p>
                                <button className="ghost lgbtn" id="signUp">Sign Up</button>
                            </div>
                        </div>
                    </div>
                </div>
            </body >
        </div >
    );
}

export default Login;
